import styled from 'styled-components';
import {Select} from 'semantic-ui-react';

export const StyledSelectFilter = styled.select`
    width: 100%;
    height: 56px;
    border-radius: 4px;
    border: solid 1px #cccccc;
    background-color: #ffffff;
    font-size: 16px;
    font-weight: normal;
    color: #333333;
    padding-left: 16px;
`;
